import './sidebar.scss';
import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Sidebar() {
    const [data, setData] = useState([]);

    useEffect(() => {
        axios.get('http://127.0.0.1:8000/api/sidebar')
            .then(res => {
                setData(res.data);
                console.log(res.data);
            })
            .catch(err => {
                console.log(err);
            });
    }, []);

    return (
        <aside className="sidebar">
            {data ? (
                <div>Загружено</div>
            ) : (
                <div>Загрузка...</div>
            )}
        </aside>
    );
}

export default Sidebar;
